import { observable, decorate, computed } from "mobx";

class TimerStore {
  seconds = 0;
  time = "00:00:00:00";
  start = false;
}
decorate(TimerStore, {
  seconds: observable,
  start: observable,
  time: computed
});

export default new TimerStore();
